UBERONParcellation.medial_dorsal_nucleus_of_thalamus = UBERONParcellation(
    id="https://openminds.om-i.org/instances/UBERONParcellation/medialDorsalNucleusOfThalamus",
    definition="Is a nucleus of dorsal thalamus. [auto-generated from 'is_a' property of the [UBERON ontology term](http://purl.obolibrary.org/obo/UBERON_0002739)]",
    description="The medial dorsal nucleus (or dorsomedial nucleus of thalamus) is a large nucleus in the thalamus. It receives inputs from the Pre-Frontal Cortex and the Limbic System and in turn relays them to the Pre-Frontal Association Cortex. As a result, it plays a crucial role in attention, planning, organization, abstract thinking, multi-tasking and active memory. The connections of the medial dorsal nucleus have even been used to delineate the prefrontal cortex of the Gttingen minipig brain. By stereology the number of brain cells in the region has been estimated to around 6.43 million neurons in the adult human brain and 36.3 million glial cells, and with the newborn having quite different numbers: around 11.2 million neurons and 10.6 million glial cells. Lesions of the medial dorsal nucleus have been associated with Wernicke's encephalopathy. [definition of the [UBERON ontology term](http://purl.obolibrary.org/obo/UBERON_0002739)]",
    interlex_identifier=IRI("http://uri.interlex.org/base/ilx_0106636"),
    knowledge_space_link=IRI("https://knowledge-space.org/wiki/UBERON:0002739#medial-dorsal-nucleus"),
    name="medial dorsal nucleus of thalamus",
    preferred_ontology_identifier=IRI("http://purl.obolibrary.org/obo/UBERON_0002739"),
    synonyms=[
        "dorsal medial nucleus of thalamus",
        "dorsomedial nucleus of thalamus",
        "medial dorsal thalamic nucleus",
        "medial nuclear group of thalamus",
        "mediodorsal nucleus of thalamus",
        "mediodorsal thalamic nucleus",
        "nucleus dorsomedialis thalami",
    ],
)
