UBERONParcellation.zona_incerta = UBERONParcellation(
    id="https://openminds.om-i.org/instances/UBERONParcellation/zonaIncerta",
    definition="Is a nucleus of ventral thalamus. [auto-generated from 'is_a' property of the [UBERON ontology term](http://purl.obolibrary.org/obo/UBERON_0001907)]",
    description="The zona incerta is a horizontally elongated region of gray matter cells in the subthalamus below the thalamus. Its connections project extensively over the brain from the cerebral cortex down into the spinal cord. Its function is unknown though several have been proposed related to 'limbic-motor integration' such as controlling visceral activity and pain; gating sensory input and synchronizing cortical and subcortical brain rhythms. Its dysfunction may play a role in central pain syndrome. It is also been identified as a promising deep brain stimulation therapy target for treating Parkinsons Disease. Its existence was first described by Auguste Forel in 1877 as a 'region of which nothing certain can be said'. A hundred and thirty years later in 2007, Nadia Urbain and Martin Deschnes of Universit Laval noted that the 'zona incerta is among the least studied regions of the brain; its name does not even appear in the index of many textbooks. '. [definition of the [UBERON ontology term](http://purl.obolibrary.org/obo/UBERON_0001907)]",
    interlex_identifier=IRI("http://uri.interlex.org/base/ilx_0112736"),
    knowledge_space_link=IRI("https://knowledge-space.org/wiki/UBERON:0001907#zona-incerta"),
    name="zona incerta",
    preferred_ontology_identifier=IRI("http://purl.obolibrary.org/obo/UBERON_0001907"),
)
